script: |
  super -f text -I q7214.spq | sort > q7214.out

inputs:
  - name: q7214.spq
    data: |
      SELECT + col0, ( col0 ) AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + 42 IN ( + col1, + ( 69 ) * - 92 - - + col1, - col0 );
  - name: tab2

outputs:
  - name: q7214.out
    data: |
      46	46
      64	64
      75	75
